import React, { component } from 'react';
import './App.css';

class App extends React.Component {
  state = {
    clients : [
      {id:1, nom:'LEE'},
      {id:2, nom:'FALL'},
      {id:3, nom:'GUEYE'},
    ]
  }
  render(){
    const title = "Liste des clients"
      return(
        <div className="App">
          <h1>{title}</h1>
          <ul>this.state.clients.map(clients => (
            <li>{clients.nom} <button>X</button>
            </li>
            ))</ul>
        </div>
      );
    }
}

export default App;
